import DefaultLayout from "../../Layouts/DefaultLayout";
import { Row, Col } from "../../components/Grid";
import PageTitle from "../../components/PageTitle";
import styled from "styled-components";

const SpaceBetween = styled(Row)`
  justify-content: space-between;
`;

const TechPage = () => {
  return (
    <DefaultLayout>
      <PageTitle title="tech stack" />
      <SpaceBetween>
        <Col width={[1, 1, 5 / 12]}>
          <h2>Code</h2>
          <p></p>
        </Col>
        <Col width={[1, 1, 5 / 12]}>
          <h2>Design</h2>
          <p>
            I am fully confident in all major design tools, my current preferred
            tools are Figma and InVison Studio for prototyping and design
            systems.
          </p>
        </Col>
      </SpaceBetween>
    </DefaultLayout>
  );
};

export default TechPage;
